import React, {Component} from 'react';

export default class TaskButton extends Component {
 

       render(){
        const {className, testFun, id} = this.props

        if(className === 'icon icon-edit'){
            return <button className={className} onClick={testFun}></button>
        } else{
            return <button className={className} onClick={()=>testFun(id, 'del')}></button>
        }
    }
}
